import React from "react";

import styled from "styled-components";

const TodoOption = (props) => {
  const { className, title } = props;

  return <TodoOptionIcon className={className} title={title || ""} />;
};

const TodoOptionIcon = styled.i(() => {
  return {
    fontSize: "1.2rem",
    color: "#777",
    cursor: "pointer",
    display: "inline-flex",
    alignItems: "center",
    borderRadius: "50%",
    padding: 5,
    "&:hover": {
      backgroundColor: "#999999",
    },
  };
});

export default TodoOption;
